$(()=>{let t=function(t){var a=t.split("?")[1];if(!a)return!1;var r=a.split("&");if(!r)return!1;for(var n={},e=0;e<r.length;e++){var i=r[e].split("=");n[i[0]]=i[1]}return n}(window.location.href);$.ajax({url:"http://127.0.0.1:3000/api/getbrand",data:t.brandtitleid,dataType:"json",success:t=>{let a=t.result,r="";a.forEach((t,a)=>{r+=`\n                <li ><a  href="./productlist.html?pageid=1&amp;categoryid=${t.categoryId}&amp;category="\n                    class=""><em  class="top1">${a}</em>\n                    <div  class="inner">\n                        <div  class="tit">${t.brandName}</div>\n                        <p >${t.brandInfo}</p>\n                    </div>\n                </a></li>\n                `}),$(".category-title").html(r)}})});